import ExpenseItem from './components/ExpenseItem';


function App(){
    let expenseDate = new Date(2024,1,1); // it is object
    let expenseTitle ="School fee";
    let expenseAmount = 300;

    return (
    <div> 
         <ExpenseItem 
         date = {expenseDate} 
         title ={expenseTitle} 
         amount={expenseAmount}></ExpenseItem>
    </div>
);
}
export default App;
